import React from 'react';
import { motion } from 'framer-motion';
import { 
  ClockIcon, 
  UserGroupIcon, 
  MapPinIcon,
  ArrowRightIcon 
} from '@heroicons/react/24/outline';

const AvailableActivitiesSection = () => {
  const activities = [
    {
      icon: "ðŸ”¸",
      title: "Cursuri de Schi",
      price: "de la 45â‚¬",
      description: "Instructori locali experimentaÈ›i",
      duration: "2â€“6 ore",
      details: "Echipament inclus | Toate nivelurile",
      group: "Grupuri mici",
      image: "https://images.unsplash.com/photo-1544551763-46a013bb70d5?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80",
      buttonText: "RezervÄƒ Activitatea"
    },
    {
      icon: "ðŸ”¸",
      title: "Excursii Montane",
      price: "de la 35â‚¬",
      description: "Trasee culturale & de munte Ã®n Bucegi",
      duration: "4â€“8 ore",
      details: "Ghid local | Transport + PrÃ¢nz",
      group: null,
      image: "https://images.unsplash.com/photo-1506905925346-21bda4d32df4?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80",
      buttonText: "RezervÄƒ Activitatea"
    },
    {
      icon: "ðŸ”¸",
      title: "Trasee Recomandate",
      price: "Gratuit",
      description: "Castelul PeleÈ™, MÃ¢nÄƒstirea Sinaia, Cota 1400",
      duration: "Flexibil",
      details: "Pe cont propriu",
      group: null,
      image: "https://images.unsplash.com/photo-1544551763-46a013bb70d5?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80",
      buttonText: "Vezi Detalii"
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const cardVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <section className="section-padding bg-background-primary">
      <div className="container-custom">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl lg:text-5xl font-display font-bold text-text-primary mb-4">
            ActivitÄƒÈ›i Disponibile
          </h2>
          <p className="text-lg text-text-light max-w-2xl mx-auto">
            Alege din varietatea de experienÈ›e pe care le oferim pentru a-È›i face È™ederea memorabilÄƒ.
          </p>
        </motion.div>

        {/* Activities Grid */}
        <motion.div
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
          className="grid grid-cols-1 lg:grid-cols-3 gap-8"
        >
          {activities.map((activity, index) => (
            <motion.div
              key={index}
              variants={cardVariants}
              className="bg-white rounded-2xl overflow-hidden shadow-lg hover:shadow-xl transition-shadow duration-300"
            >
              {/* Image */}
              <div className="relative h-48 overflow-hidden">
                <img
                  src={activity.image}
                  alt={activity.title}
                  className="w-full h-full object-cover"
                  loading="lazy"
                />
                <div className="absolute inset-0 bg-gradient-to-t from-black/30 via-transparent to-transparent"></div>

                {/* Price Badge */}
                <div className="absolute top-4 right-4 bg-primary-500 text-white px-3 py-1 rounded-lg text-sm font-medium">
                  {activity.price}
                </div>
              </div>

              {/* Content */}
              <div className="p-6">
                <div className="flex items-start justify-between mb-3">
                  <span className="text-2xl">{activity.icon}</span>
                  <h3 className="text-xl font-display font-bold text-text-primary flex-1 ml-2">
                    {activity.title}
                  </h3>
                </div>

                <p className="text-text-light mb-4">
                  {activity.description}
                </p>

                {/* Details */}
                <div className="space-y-2 mb-6">
                  <div className="flex items-center space-x-2 text-sm text-text-light">
                    <ClockIcon className="w-4 h-4" />
                    <span>{activity.duration}</span>
                  </div>
                  <div className="flex items-center space-x-2 text-sm text-text-light">
                    <MapPinIcon className="w-4 h-4" />
                    <span>{activity.details}</span>
                  </div>
                  {activity.group && (
                    <div className="flex items-center space-x-2 text-sm text-text-light">
                      <UserGroupIcon className="w-4 h-4" />
                      <span>{activity.group}</span>
                    </div>
                  )}
                </div>

                {/* CTA Button */}
                <motion.button
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  className="w-full bg-primary-500 text-white py-3 px-4 rounded-xl font-medium hover:bg-primary-600 transition-colors duration-300 flex items-center justify-center space-x-2"
                >
                  <span>{activity.buttonText}</span>
                  <ArrowRightIcon className="w-4 h-4" />
                </motion.button>
              </div>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default AvailableActivitiesSection;
